import React, { Component } from 'react';

class Requirements extends Component {
    render() {
        return (
            <div>
                <h1>Requirements</h1>
                <p>First step to getting your dog enrolled in our doggy daycare, boarding or grooming, is take to make sure he/she is up to date on their shots. For health and safety purposes, we require every dog that stays at Zinky's to have the following vaccinations:
                    <ul>
                    <li>Rabies</li>
                    <li>Bordetella (kennel cough)</li>
                    <li></li>
                    </ul>
                </p>
                <p>Every pup is required to go through a temperament test before joining our other visitors. This ensures the safety of every pup in our facility. Our trained staff will do test to measures your dog's reaction or behavior to various elements presented to them. After they are cleared, they get to join the party! Don't worry, if your pup doesn't pass, there is still a place for them at Zinky's. We have seperate rooms for our special pups who don't feel like playing with the other pups. They will still get plenty of attention from our staff! </p>
            </div>
        );
    }
}

export default Requirements;
